import { Routes, Route, Link } from 'react-router-dom';


const Contacto= ()=> {
  return (
    <>
      <h1>Contacto</h1>   
      <nav>
        <ul></ul>
      </nav>
    </>
  )
}

function App() {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Inicio</Link>
          </li>
          <li>
            <Link to="/contacto">Contacto</Link>
          </li>
        </ul>
      </nav>
      <section>
        <Routes>
          <Route path="/contacto" element={Contacto()} />
          <Route exact path="/" element={<h1>Inicio</h1>} />
        </Routes>

      </section>
    </div>
  );
}

export default App;
